import logo from "./logo.svg";
import "./App.css";
import TodoList from "./components/TodoList";
import "bootstrap/dist/css/bootstrap.min.css";
import { DragDropContext, Droppable } from "react-beautiful-dnd";

function App() {
  return (
    <DragDropContext>
      <Droppable>
        {(provided) => (
          <div className='App'>
            <TodoList />
          </div>
        )}
      </Droppable>
    </DragDropContext>
  );
}

export default App;
